cking-fraud-detection/data\n","\n","> Arquivos disponíveis:  \n","  \n","* **train.csv** - Dados para treino.\n","* **train_sample.csv** - Amostra selecionada aleatóriamente de 100,000 linhas dos dados de treino.\n","* **test.csv** - Dados de teste.\n","* **sampleSubmission.csv** - Amostra de dados para subimssão na competição.\n","* **test_supplement.csv** - Dados de teste disponibilizados por acidente. Os dados de teste são um subset desde arquivo."]},{"cell_type":"markdown","id":"d3fa55fd","metadata":{"papermill":{"duration":0.10184,"end_time":"2022-01-23T16:16:37.367943","exception":false,"start_time":"2022-01-23T16:16:37.266103","status":"completed"},"tags":[]},"source":["---\n","### > **Etapa 3**: Análise Exploratória\n","\n","> Descrição dos Atributos\n","1. **_Dados de Treino_**\n","* **ip**: endereço de ip do click.\n","* **app**: id do aplicativo anunciado.\n","* **device**: id do tipo de dispositivo móvel do usuário (e.g., iphone 6 plus, iphone 7, huawei mate 7, etc.).\n","* **os**: id da versão do OS do usuário móvel.\n","* **channel**: id do canal do editor do anúncio.\n","* **click_time**: data/hora do click (UTC).\n","* **attributed_time**: horário do download do aplicativo, após clique no anúncio, caso seja realizado.\n","* **is_attributed**: atributo alvo para previsão, indicando se o aplicativo foi ou não baixado\n","\n","2. **_Dados de Teste:_** similar ao de treino, com as seguintes diferenças\n","* **click_id**: referência para previsão\n","* **is_attributed**: não incluído"]},{"cell_type":"code","execution_count":1,"id":"20ef1053","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-01-23T16:16:37.574425Z","iopub.status.busy":"2022-01-23T16:16:37.571772Z","iopub.status.idle":"2022-01-23T16:16:41.227517Z","shell.execute_reply":"2022-01-23T16:16:41.226036Z"},"papermill":{"duration":3.759798,"end_time":"2022-01-23T16:16:41.227701","exception":false,"start_time":"2022-01-2